import React from "react";
import {Link} from "react-router-dom";
import "./dashboard.css"

const Dashboard = ({ Username }) => {
    return(
        <div className="Body">
            <div className="Header">
            <h1>Welcome , {Username}</h1>
           
            </div>
           
        </div>
    )
    
}

export default Dashboard;
